import React from 'react';
import { Bar } from 'react-chartjs-2';
import { Card, CardContent, Typography } from '@mui/material';

const DashboardChimistes = () => {
  const data = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    datasets: [
      {
        label: 'Produits Vendus',
        data: [65, 59, 80, 81, 56, 55],
        backgroundColor: 'rgba(75, 192, 192, 0.6)',
        borderColor: 'rgba(75, 192, 192, 1)',
        borderWidth: 1,
      },
    ],
  };

  return (
    <div style={{ padding: '20px' }}>
      <Typography variant="h4" gutterBottom>
        Tableau de Bord des Chimistes
      </Typography>

      <Card>
        <CardContent>
          <Typography variant="h5">Ventes Mensuelles</Typography>
          <Bar data={data} options={{ responsive: true }} />
        </CardContent>
      </Card>

      <Card style={{ marginTop: '20px' }}>
        <CardContent>
          <Typography variant="h5">Statistiques des Produits</Typography>
          <Typography variant="body1">Nombre total de produits : 150</Typography>
          <Typography variant="body1">Produits en rupture de stock : 5</Typography>
        </CardContent>
      </Card>
    </div>
  );
};

export default DashboardChimistes;
